import React from "react";
import buttons1 from "../assets/images/Group 2.png";
import buttons2 from "../assets/images/Group 4.png";
import buttons3 from "../assets/images/Group 3.png";

function Buttons1() {
  return (
    <div className="items">
      <div className="buttons1">
        <img src={buttons1} alt="" />
      </div>
    </div>
  );
}

function Buttons2() {
  return (
    <div className="items">
      <div className="buttons2">
        <img src={buttons2} alt="" />
      </div>
    </div>
  );
}

function Buttons3() {
  return (
    <div className="items">
      <div className="buttons3">
        <img src={buttons3} alt="" />
      </div>
    </div>
  );
}
const Buttons = {
  Buttons1,
  Buttons2,
  Buttons3,
};

export default Buttons;
